var image = new Image()
image.src = "data:image/jpeg;base64,"

image.addEventListener("load",function(){
    console.log("ands")
    const canvas = document.getElementById("canvas")
    const ctx = canvas.getContext('2d')
    
    canvas.width = 480
    canvas.height = 480

    let mappedImage = []
    let particlesArray = []

    const mouse = {
        x: null,
        y: null,
        radius: 50,
    };
    
    canvas.addEventListener("mousemove", function (event) {
        mouse.x = event.offsetX;
        mouse.y = event.offsetY;
    });
    

    ctx.drawImage(image,0,0,canvas.width,canvas.height)
    const imageData = ctx.getImageData(0,0,canvas.width,canvas.height)
    

    class Particles{
        constructor(x,y,opacity){
            this.x = x
            this.y = y
            this.size = 1.2
            this.opacity = opacity
            this.color = `rgba(225,225,225,${opacity})`
            this.baseX = x
            this.baseY = y
            this.density = Math.random() * 30 + 1;
        }

        draw(){
            ctx.fillStyle = this.color;
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.closePath();
            ctx.fill();
        }

        update() {
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);
    
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
    
            let maxDistance = mouse.radius;
            let force = (maxDistance - distance) / maxDistance;
            let forceX = force * forceDirectionX * this.density;
            let forceY = force * forceDirectionY * this.density;

            if (distance < mouse.radius) {
                this.x -= forceX;
                this.y -= forceY;
                this.color = `rgba(255,255,0,${this.opacity})`
            } else {
                this.color = `rgba(255,255,255,${this.opacity})`
                if (this.x != this.baseX) {
                    let dx = this.x - this.baseX;
                    this.x -= dx / 10;
                }
                if (this.y != this.baseY) {
                    let dy = this.y - this.baseY;
                    this.y -= dy / 10;
                }
            }
        }
    }

    function init(){
        particlesArray = []
        for (let y = 0; y < imageData.height; y+=5) {
            let row = []
        	for (let x = 0; x < imageData.width; x+=5) {
                const red = imageData.data[(y*4*imageData.width) + (x*4)]
                const green = imageData.data[(y*4*imageData.width) + (x*4 + 1)]
                const blue = imageData.data[(y*4*imageData.width) + (x*4 + 2)]


                const brightness = calculateRelativeBrightness(red,green,blue)
                const cell = [
                    cellBrightness = brightness
                ]
                row.push(cell)

        		var positionX = x;
                var positionY = y;
                particlesArray.push(new Particles(positionX, positionY,brightness));
        	}

            mappedImage.push(row)
        }
    }

    

    function calculateRelativeBrightness(red,green,blue){
        return Math.sqrt(
            (red * red) * 0.299 + (green*green)*0.587 + (blue*blue)*0.114
        )/100
    }

    init()

    console.log(particlesArray)

    function animate() {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        for (let particle of particlesArray) {
            particle.update();
            particle.draw();
        }
        requestAnimationFrame(animate);
    }

    animate()

})
